import React from "react";

export const Footer = () => {
  return (
    <section>
      {/* <div className="">
                <img
                    className="w-3"
                    src="/treaty-png-1.svg"
                    alt=""
                />
            </div> */}
        <div className="flex flex-wrap">
          <div className="w-6/12">
            
            <img className="" src="/treaty-png-1.svg" alt="" />
          </div>
          <div className="w-full md:w-4/12">
          <img src="Rectangle 7.svg" alt="About" className="p-4" />
          </div>
        </div>
    </section>
  );
};
